column8:
国内で加工された8種類の風味原料をバランス良く配合し、粉末醤油や発酵調味料で下味を付けました。だし本来の風味を活かすため、化学調味料(アミノ酸等)は使用せず仕上げました。だしパックタイプなので、沈殿物を気にすることなく、澄んだだしがとれます。豊かな香りと味わいは普段のご家庭のレシピを本格派な料理に引き立てます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">国内で加工された8種類の風味原料をバランス良く配合し、粉末醤油や発酵調味料で下味を付けました。だし本来の風味を活かすため、化学調味料(アミノ酸等)は使用せず仕上げました。だしパックタイプなので、沈殿物を気にすることなく、澄んだだしがとれます。豊かな香りと味わいは普段のご家庭のレシピを本格派な料理に引き立てます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">8g×18包</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：16×7×23cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：177g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
