8種類の国内産素材のみをそのまま粉砕した、煮だし不要の顆粒タイプだし「全部食べるだしパウダー」。あご(飛び魚)や根昆布など、ご家庭では揃えにくい素材を使用しています。煮物や汁ものだけではなく、混ぜたり、ふりかけたり、隠し味に使ったりといろいろな用途にご使用いただけます。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">8種類の国内産素材のみをそのまま粉砕した、煮だし不要の顆粒タイプだし「全部食べるだしパウダー」。あご(飛び魚)や根昆布など、ご家庭では揃えにくい素材を使用しています。煮物や汁ものだけではなく、混ぜたり、ふりかけたり、隠し味に使ったりといろいろな用途にご使用いただけます。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：29×44×15cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：3802g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">賞味期間：製造日より365日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">9Pセット</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
